import React from 'react'
import '../styles/matchScene.css'
import MatchCard from './MatchCard'
import scrappyRed from '../media/Updated_Logo_red.png'; 
import scrappyBlue from '../media/Updated_Logo_blue.png'; 

export default function MatchScene({names}) {
  return (
    <div className='backdrop'>
      <MatchCard names={names} col_style={"fighter-confirmed"} scrappy={scrappyRed}></MatchCard>
      <MatchCard names={names} st={"fighter-confirmed fighter2"} scrappy={scrappyBlue}></MatchCard>
    </div>
  )
}
